For now, I have found that I can include the `.js` file that is found from the Google Analytics site within the first `<script>` as `gtag.js` within the `_static` directory. Furthermore, I created a second `.js` file, `gtag_1.js` also within the `_static` directory that contains the code provided between the `<script>` and `</script>`, which is currently:
```
window.dataLayer = window.dataLayer || [];
  function gtag(){dataLayer.push(arguments);}
  gtag('js', new Date());

  gtag('config', '<your code here>');
```

---

I think the bug of this issue might stem from `gtag` being used instead of `ga`, which seems to be used currently as it is appended to the bottom of each HTML page.
